Count 1 - Possess THC (2nd+offense) - Guilty plea.  Convicted.  State moves to dismiss and read in count 2, possess drug paraphernalia.  Motion granted.  Sentence is withheld.  Defendant is placed on probation to DOC for eighteen (18) months.  Conditions of probation are:
1) Thirty (30) days jail, to be imposed at agent's discretion;
2) AODA assessment and follow through;
3) Submit to random urine screens and pay for same, one to be given within the next 45 days;
4) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process;
5) Complete 100 hours of community service work;
6) Provide DNA sample;
7) Pay costs ofa ction; 
8) Pay supervision fees in an amount to be determined by DOC.  
If the defendant successfully completes probation and 100 hours of community service work and has no positive drug screens, the Court would find expungment is appropriate pursuant to Section 973.015 of the Wisconsin Statutes, finding that defendant will benefit and society will not be harmed.  
$200.00 cash bail applied to court costs.  
